DROP DATABASE IF EXISTS `event_page`;
CREATE DATABASE IF NOT EXISTS `event_page`;
USE `event_page`;

CREATE TABLE `city` (
  `id`   INT(10)          UNSIGNED NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(30)      NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE = InnoDB DEFAULT CHARSET = utf8;

CREATE TABLE `role` (
  `id`   INT(10)          UNSIGNED NOT NULL AUTO_INCREMENT,
  `role` VARCHAR(255)     NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE = InnoDB AUTO_INCREMENT = 1 DEFAULT CHARSET = utf8;

CREATE TABLE `user` (
  `id`       INT(10)          UNSIGNED NOT NULL AUTO_INCREMENT,
  `username` VARCHAR(255)     DEFAULT NULL,
  `password` VARCHAR(255)     DEFAULT NULL,
  `email`    VARCHAR(255)     DEFAULT NULL,
  `ime`      VARCHAR(255)     DEFAULT NULL,
  `prezime`  VARCHAR(255)     DEFAULT NULL,
  `role_id`  INT(10)          UNSIGNED DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_user_role_id_idx` (`role_id`),
  CONSTRAINT `fk_book_role_id` FOREIGN KEY (`role_id`) REFERENCES `role` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB DEFAULT CHARSET = utf8;

CREATE TABLE `place` (
  `id`          INT(10)          UNSIGNED NOT NULL AUTO_INCREMENT,
  `name`        VARCHAR(50)      NOT NULL,
  `description` VARCHAR(255)     DEFAULT NULL,
  `picture`     LONGBLOB         DEFAULT NULL,
  `place_url`   TEXT             DEFAULT NULL,
  `address`     VARCHAR(50)      NOT NULL,
  `city_id`     INT(10)          UNSIGNED NOT NULL,
  `manager_id`  INT(10)          UNSIGNED NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_place_city_id_idx` (`city_id`),
  CONSTRAINT `fk_place_city_id` FOREIGN KEY (`city_id`) REFERENCES `city` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  KEY `fk_place_manager_id_idx` (`manager_id`),
  CONSTRAINT `fk_place_manager_id` FOREIGN KEY (`manager_id`) REFERENCES `user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB DEFAULT CHARSET = utf8;

CREATE TABLE `category` (
  `id`          INT(10)          UNSIGNED NOT NULL AUTO_INCREMENT,
  `name`        VARCHAR(255)     NOT NULL,
  `description` VARCHAR(255),
  PRIMARY KEY (`id`)
) ENGINE = InnoDB DEFAULT CHARSET = utf8;

CREATE TABLE `event` (
  `id`          INT(10)          UNSIGNED NOT NULL AUTO_INCREMENT,
  `name`        VARCHAR(50)      NOT NULL,
  `date_time`   DATETIME         NOT NULL,
  `description` TEXT             DEFAULT NULL,
  `picture`     LONGBLOB         DEFAULT NULL,
  `category_id` INT(10)          UNSIGNED NOT NULL,
  `place_id`    INT(10)          UNSIGNED NOT NULL,
  `price`       DOUBLE           NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_category_id12_idx` (`category_id`),
  CONSTRAINT `fk_category12_id` FOREIGN KEY (`category_id`) REFERENCES `category` (`id`),
  KEY `fk_place_id11_idx` (`place_id`),
  CONSTRAINT `fk_place11_id` FOREIGN KEY (`place_id`) REFERENCES `place` (`id`)
) ENGINE = InnoDB DEFAULT CHARSET = utf8;

