Dok teku pripreme za veliki koncert u Sarajevu Tony je nekoliko dana proveo u Johanesburgu gdje je snimio dvije pjesme i spot u saradnji sa klapom Ova klapa sa Korčule. ",
1, 1, 5);
INSERT INTO event (id, name, date_time, picture, description, category_id, place_id, price) VALUES
(16, "Bijelo Dugme na Bjelašnici", "2019-12-29 14:00:00", "data:image/JPEG;base64," ,"Hajdemo u planine jer tamo nema zime...
Legendarni Sarajlija Goran Bregović zajedno s Alenom Islamovićem i Mladenom Vojičićem Tifom tim koncertom će upotpunit slavljeničku atmosferu

Promocija povodom otvorenja zimske ski sezone ”Bjelašnica-Igman 2019/2020” bit će održana sutra na Bjelašnici.


Bit će predstavljen program manifestacije „Hajdemo u planine“ u okviru koje će 29. decembra, na otvorenom prostoru (Babin do) biti održan koncert grupe Bijelo dugme, s početkom u 14.00 sati.

Legendarni Sarajlija Goran Bregović zajedno s Alenom Islamovićem i Mladenom Vojičićem Tifom tim koncertom će upotpunit slavljeničku atmosferu povodom 35. rođendana ZOI'84.

Na promociji će se obratiti direktor ZOI'84 Nevres Alispahić, Midhat Hubijar direktor Turističke zajednice KS, Mevludin Halilović komesar MUP-a KS, kao i lider grupe ”Bijelo Dugme” Goran Bregović s rediteljem Ademirom Kenovićem – prijateljem projekta i autorom teksta ”Hajdemo u planine”, saopćili su organizatori.",
1, 1, 0);